import React from "react";


class NevigationMenu extends React.Component{
    render(){
        return(
            <div>
                <ul>
                    <li>Home</li>
                    <li>About</li>
                    <li>Project</li>
                    <li>Contact</li>
                </ul>
            </div>
        )
    }
}

export default NevigationMenu
